import React from 'react';

const HomePage = () => {
  return (
    <div>
      <img src="/home.png" alt="Home" style={{ width: '100%', height: '45%', position: 'absolute', top: 0, left: '50%', transform: 'translateX(-50%)', zIndex: 1000 }} />
      <div style={{ paddingTop: '60px' }}>This is the Home Page</div>
    </div>
  );
};

export default HomePage;
